export default function Jumbotron() {
    return (
        <div className="jumbotron mt-3 bg-light">
            <div className="container">
                <h1 className="display-3 mb-3 justify-content-center">Traveling</h1>
                <p className="lead mb-4">
                    Estén planeando o de viaje, los viajeros recurren a Traveling para comparar precios bajos en hoteles, vuelos y cruceros, reservar excursiones y atracciones populares, así como reservar mesa en excelentes restaurantes. Traveling, el mejor compañero de viaje.
                </p>
            </div>
        </div>
    )
}
